@notice lp getter function
 @param tokenId the id of the token
 @return owner the owner of the token
 @return token0 the first token in the pool
 @return token1 the second token in the pool
 @return fee the fee of the pool
 @return tickLower the lower tick of the position
 @return tickUpper the upper tick of the position
 @return liquidity the liquidity of the position
 @return feeGrowthInside0LastX128 the fee growth of the position as of the last action on the individual position
 @return feeGrowthInside1LastX128 the fee growth of the position as of the last action on the individual position
 @return tokensOwed0 how many uncollected tokens are owed to the position, as of the last computation
 @return tokensOwed1 how many uncollected tokens are owed to the position, as of the last computation
